import { roadmapData } from "../../constant"
import { RoadmapCard } from "./RoadmapItem"

export const Roadmap = () => {
    return(
        <section>
        {
            roadmapData.map((item) => 
            <RoadmapCard data={item} key={item.id}/>
            )
        }
        </section>
    ) 
    
}
